import { useRouter } from 'next/router'

function CustomLink({ children, href, effect}) {
    const router = useRouter()

    const handleClick = (e) => {
        e.preventDefault()
        router.push(href)
      }
    return (
        <a href={href} onClick={handleClick}>
            {children}
        </a>
    )
}

export default CustomLink
